import React from "react";

function UsersTable(props) {
  const users = props.users;
  return (
    <ul>
      {users.map((event) => (
        <li key={event.username}>
          {event.username} ({event.age} years old)
        </li>
      ))}
    </ul>
  );
}

export default UsersTable;
